	@Test
	public void testQueryCode(){
		try {
			QueryCodeDTO queryCodeDTO = new QueryCodeDTO();
			// 省
			queryCodeDTO.setCodeType("PROVINCE");
			queryCodeDTO.setCode("110000");
			QueryCodeResponseDTO provinceResult = applyFacade.queryCode(queryCodeDTO);
			System.out.println("省编码查询结果：" + provinceResult.getQueryResult());
			// 市&区
			queryCodeDTO.setCodeType("CITY_OR_DISTRICT");
			queryCodeDTO.setCode("120100");
			QueryCodeResponseDTO cityResult = applyFacade.queryCode(queryCodeDTO);
			System.out.println("市&区编码查询结果：" + cityResult.getQueryResult());
			// 银行
			queryCodeDTO.setCodeType("BANK");
			queryCodeDTO.setCode("HXB");
			QueryCodeResponseDTO bankResult = applyFacade.queryCode(queryCodeDTO);
			System.out.println("银行编码查询结果：" + bankResult.getQueryResult());
			// 一级分类
			queryCodeDTO.setCodeType("LEVEL1");
			queryCodeDTO.setCode("105");
			QueryCodeResponseDTO level1Result = applyFacade.queryCode(queryCodeDTO);
			System.out.println("一级分类编码查询结果：" + level1Result.getQueryResult());
			// 二级分类
			queryCodeDTO.setCodeType("LEVEL2");
			queryCodeDTO.setCode("106");
			QueryCodeResponseDTO level2Result = applyFacade.queryCode(queryCodeDTO);
			System.out.println("二级分类编码查询结果：" + level2Result.getQueryResult());
		} catch(Throwable t){
			t.printStackTrace();
		}
	}
	
